import React from 'react';
import '../styles/cover.css'
import logo_white from './icons/logo_white.png';
import Typical from 'react-typical'
import 'bootstrap/dist/css/bootstrap.min.css';
import bot_section from './icons/bot_section.png';
import '../styles/bot-section.css';
import Button from 'react-bootstrap/Button';
import '../styles/eva.css';
import sample from './'



class EVA extends React.Component {
  render() {

    return (
         <div className="eva-cover">
            <video className='videoTag' autoPlay loop muted>
                <source src={sample} type='video/mp4' />
            </video>
           <Typical className="eva-head"
            steps={['Designing Products that matter.',1]}
            loop={2}
            wrapper="p"
          />
        </div>
    );
  }
}
export default EVA;
